import React from "react";
import {
  Nav,
  Navbar,
  NavDropdown,
  Form,
  FormControl,
  Button,
  Jumbotron,
  Container,
} from "react-bootstrap";

function Home() {
  return (
    <div>
      <Navbar bg="light" expand="lg">
        <Navbar.Brand href="/">
          <img
            src="/logo.png"
            width="60"
            height="60'
        "
            className="d-inline-block align-top"
            alt="React Bootstrap logo"
          />
        </Navbar.Brand>
      </Navbar>
      <h1>Checkout:</h1>
    </div>
  );
}

export default Home;
